import React, { useState, useEffect } from "react";
import { DragSource } from "react-dnd";

const itemSource = {
  beginDrag(props) {
    console.log(props, "BEING DRAG SOURCE");
    return props.employee;
  },
};

function collect(connect, monitor) {
  console.log(connect, "CONNNECT");
  console.log(monitor, "MONITOOOOOOOOOOOOR");
  return {
    connectDragSource: connect.dragSource(),
    isDragging: monitor.isDragging(),
  };
}
function Employee(props) {
  console.log(props, "EMPLOYEE PROPS");
  const { connectDragSource } = props;
  return connectDragSource(
    <div className="item">
      <ul>{props.employee.Name}</ul>
    </div>
  );
}

export default DragSource("item", itemSource, collect)(Employee);
